import React from 'react';
import { connect } from 'react-redux';
import { fetchPlanets } from '../actions';
import PropTypes from 'prop-types';

class Table extends React.Component{
  componentDidMount(){
    const { getCurrentPlanets } = this.props;
    let oi = getCurrentPlanets();
    console.log(oi);
    <div>{getCurrentPlanets.map((results)=>{
      <p>{results.planet}</p>
    })}</div>
  }
  render (){
     const { swPlanetss, oi, getCurrentPlanets } = this.props
    return(
      <section>
        <div> 
          {getCurrentPlanets.map((results)=>{
            <p>{results.planet}</p>
          })}
        </div>
    <div>StarWars Datatable with Filters</div>
    </section>
    )
  }
  }

const mapStateToProps = (state) => ({
  swPlanetss: state.swPlanetss.data,
})
const mapDispatchToProps = (dispatch) => ({
  getCurrentPlanets: () => dispatch
  (fetchPlanets()),
})

ApplicationCache.propTypes = {
  getCurrentPlanets: PropTypes.func.isRequired,
};

export default connect(null,mapDispatchToProps)(Table);
